function makePopupcontent(stopper){
    return `
        <div>
            <h4>${stopper.properties.name}</h4>
        </div>
    `;
}
function onEachFeature(feature,layer){
    layer.bindPopup(makePopupcontent(feature),{closeButton:false,offset:L.point(0,-8)});


 }
var myicon=L.icon({
    iconUrl:'location-pin.png',
    iconSize:[30,40],
    
})
const stopsLayer=L.geoJSON(listr,{
    onEachFeature:onEachFeature,
    pointToLayer:function(feature,latlng){
        return L.marker(latlng,{icon:myicon});
    }
});
stopsLayer.addTo(map);
function flyToStop(stop){
    const lat=stop.properties.coordinates[1];
    const lng= stop.properties.coordinates[0];
    map.flyTo([lat,lng],14,{duration:3});
    L.popup({closeButton:false,offset:L.point(0,-8)})
    .setLatLng([lat,lng])
    .setContent(makePopupcontent(stop))
    .openOn(map);
}
function searchItems() {
    const searchTerm = document.getElementById('search-input').value.toLowerCase();
    const resultsContainer = document.getElementById('search-results');
  
    // Clear any previous results
    resultsContainer.innerHTML = '';
  
    // Filter items based on search term
    const filteredItems = listr.filter(item => 
      item.stop.properties.name.toLowerCase().includes(searchTerm)
    );
  
    // Display filtered results
    filteredItems.forEach(item => {
      const listItem = document.createElement('li');
      listItem.textContent = item.stop.properties.name; // Accessing the name property
      
      // Add click event to fly to the selected location
      listItem.onclick = function() {
        map.flyTo(item.stop.coordinates, 15); // Fly to the selected item coordinates (zoom level 15)
      };
      
      resultsContainer.appendChild(listItem);
    });
  
    // If no results, show a no-match message
    if (filteredItems.length === 0) {
      const noResultsItem = document.createElement('li');
      noResultsItem.textContent = 'No results found';
      resultsContainer.appendChild(noResultsItem);
    }
  }